### Current and expected behavior

When I use 
```
@babel/helpers: 7.20.x
@babel/runtime: 7.16.x
```
The output code always inserts `_regeneratorRuntime` method in  @babel/helper's mode.

When I use 
```
@babel/helpers: 7.20.x
@babel/runtime: 7.20.x
```
or
```
@babel/helpers: 7.16.x
@babel/runtime: 7.16.x
```
The output code work well.

### Environment

- @babel/helpers: 7.20.x
- @babel/runtime: 7.16.x

### Possible solution

@babel/helper add inline ployfill in this pr: https://github.com/babel/babel/pull/14538.

When our company uses babel, it will install @babel/core and @babel/plugin-transform-runtime that lock the patch version for new projects, but the @babel/helper that depends on @babel/core locks the minor version. 

So creating a new project at this moment will cause the above-mentioned dependency version problem.



